/// assert_eq!(None, len(&["(a)", "b"])?);
/// assert_eq!(None, len(&["a", "(b)"])?);
/// assert_eq!(None, len(&["(a)", "(b)*"])?);
/// assert_eq!(Some(2), len(&["(a)+", "(b)+"])?);
///
/// # Ok::<(), Box<dyn std::error::Error>>(())
/// ```
